svg.script:
	    function setGroupClickFunction(){
			document.documentElement.style.webkitUserSelect='none';
			document.documentElement.style.webkitTouchCallout='none';

			var svg = document.getElementsByTagName("svg");
			for(var i=0; i<svg.length; i++){
				svg[i].setAttribute("onclick","hideLine()");
			}

			var groups = document.getElementsByTagName("g");
			for (var i=0;i<groups.length;i++){
				//if(groups[i].id.substr(0, 3)=="sn-"){
				if(groups[i].id.substr(0, 3)=="站名-"){
					//站点名字
					groups[i].setAttribute("onclick","showStation(this)");
            				groups[i].style.webKitTapHighlightColor="rgba(0,0,0,0)";
				}else if(groups[i].id.substr(0, 2)=="单站"){
					//站点标记
					groups[i].setAttribute("onclick","showStation(this)");
		//        }else if(groups[i].id.substr(0, 2)=="l-"){
				}else if(groups[i].id.substr(0, 1)=="L" && groups[i].id.indexOf("-")<0){
					//线路
					groups[i].setAttribute("onclick","showLine(this)");
				}
			}
			resetSVGSize(2880,1800);
		};

		function resetSVGSize(width, height){
			var svg = document.getElementsByTagName("svg");
			for(var i=0; i<svg.length; i++){
				var svgWidth = svg[i].getAttribute("width").replace("px","");
				var svgHeight = svg[i].getAttribute("height").replace("px","");

				var scale1 = width/svgWidth;
				var scale2 = height/svgHeight;
				var scale = scale1>scale2?scale1:scale2;
				svg[i].setAttribute("width",svgWidth*scale+"px");
				svg[i].setAttribute("height",svgHeight*scale+"px");

				if(svg[i].getAttribute("svg-width")==null) svg[i].setAttribute("svg-width",svgWidth);
				if(svg[i].getAttribute("svg-height")==null) svg[i].setAttribute("svg-height",svgHeight);
				if(svg[i].getAttribute("frame-width")==null) svg[i].setAttribute("frame-width",width);
				if(svg[i].getAttribute("frame-height")==null) svg[i].setAttribute("frame-height",height);
				if(svg[i].getAttribute("svg-scale")==null) svg[i].setAttribute("svg-scale",scale);
			}
		};

		function showStation(station){
			var ev = window.event || arguments.callee.caller.arguments[0];
			if (window.event) ev.cancelBubble = true;
			else {
				ev.stopPropagation();
			}
			hideLine();

			var svg = document.getElementsByTagName("svg");
			var scale = svg[0].getAttribute("svg-scale");
			var width = svg[0].getAttribute("frame-width");
			var height = svg[0].getAttribute("frame-height");
    		var location = getTranslate(station);
    		//window.scrollTo({top: (location[1]-height/2)*scale, left: (location[0]-width/2)*scale, behavior: "smooth"});
    		window.scrollTo({top: (location[1])*scale, left: (location[0])*scale, behavior: "smooth"});
    		//slowScrollTo(window, (location[1])*scale, (location[0])*scale);
		};

		function showLine(line){
			var ev = window.event || arguments.callee.caller.arguments[0];
			if (window.event) ev.cancelBubble = true;
			else {
				ev.stopPropagation();
			}
			//隐藏其它线路
			var groups = document.getElementsByTagName("g");
			for (var i=0;i<groups.length;i++){
				if(groups[i].id.substr(0,1)=="L" && groups[i].id.indexOf("-")<0 && groups[i]!=line){
					if(groups[i].getAttribute("opacity")==null) {
						groups[i].setAttribute("opacity","0.2");
						groups[i].classList.add("auto-hidden");
					}
				}
			}
			line.removeAttribute("opacity");
			//TODO 隐藏换乘点
		};

		function hideLine(){
			var otherLines = document.getElementsByClassName("auto-hidden");
			for (var j=0;j<otherLines.length;j++){
				otherLines[j].removeAttribute("opacity");
			}
		};

		function getTranslate(element){
			var location = [0,0];
			if(element.getAttribute("transform")!=null){
				location = element.getAttribute("transform").replace("translate(","").replace(")","").split(",");
			}
			if(element.parentElement!=null){
				var parentLocation = getTranslate(element.parentElement);
				location[0] = parseInt(location[0]) + parentLocation[0];
				location[1] = parseInt(location[1]) + parentLocation[1];
			}
			return location;
		};


		function slowScrollTo(element, x, y){
			var timer = null;
			var nowX = window.pageXOffset;
			var nowY = window.pageYOffset;
			//获取步长
			var xStep = (x-nowX)/10;
			var yStep = (y-nowY)/10;
			xStep = xStep>0?Math.ceil(xStep):Math.floor(xStep);
			yStep = yStep>0?Math.ceil(yStep):Math.floor(yStep);
			var checkX = nowX>x;

			clearInterval(timer);
			timer = setInterval(function () {
				nowX = nowX + xStep;
				nowY = nowY + yStep;
				//屏幕(页面)滚动
				element.scrollTo({top:nowY, left:nowX, behavior: "smooth"});  //屏幕(页面)滚动到某个位置
				//清除定时器
				if(checkX ? nowX <= x : nowX >= x){
					clearInterval(timer);
				}
			},25);
		};
